import { addSlugToProduct } from '../../services/helpers/product';
import { getAllProducts } from '../../services/apis/products';

export const getProducts = () => {
  console.log('hellllo');
  getAllProducts()
    .then((res) => {
      if (res.data && res.data.success) {
        dispatch({
          type: SET_PRODUCTS,
          payload: res.data.data,
        });
      }
    })
    .catch((err) => {
      console.log({ err });
    });
};

